import {
  Routes,
  BrowserRouter as Router,
  Route,
} from 'react-router-dom';

import { Home } from './pages/Home';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/*:postPageCount" >
          <Route path=":postPageCount" element={<Home />}></Route>
        </Route>
      </Routes>
    </ Router>
  );
}

export default App;
